import { useState } from "react";

export default function LeaveApply() {
  const [leaveType, setLeaveType] = useState("");
  const [date, setDate] = useState("");
  const [session, setSession] = useState("");
  const [showAdjust, setShowAdjust] = useState(false);

  const availableCL = 0; // from LeaveCheck / DB

  const timetableToday = [
    { hour: 2, subject: "DBMS", section: "CSE II A" }
  ];

  const handleLeaveType = (value) => {
    if (value === "CL" && availableCL <= 0) {
      alert("CL not available, please select LOP");
      setLeaveType("");
    } else {
      setLeaveType(value);
    }
  };

  const checkAdjustment = () => {
    if (timetableToday.length > 0) {
      setShowAdjust(true);
    } else {
      alert("Leave applied successfully. No class adjustment required.");
    }
  };

  return (
    <div>
      <label>Leave Type</label>
      <select onChange={(e) => handleLeaveType(e.target.value)}>
        <option value="">Select</option>
        <option value="CL">Casual Leave</option>
        <option value="LOP">Loss of Pay</option>
      </select>

      <label>Date</label>
      <input type="date" onChange={(e) => setDate(e.target.value)} />

      <label>Session</label>
      <select onChange={(e) => setSession(e.target.value)}>
        <option value="">Select</option>
        <option>FN</option>
        <option>AN</option>
        <option>Full Day</option>
      </select>

      <button onClick={checkAdjustment}>Apply Leave</button>

      {showAdjust && (
        <div style={{ marginTop: "15px" }}>
          <h4>Class Adjustment Required</h4>

          <table className="timetable">
            <thead>
              <tr>
                <th>Hour</th>
                <th>Subject</th>
                <th>Section</th>
                <th>Adjusting Faculty</th>
              </tr>
            </thead>
            <tbody>
              {timetableToday.map((t, i) => (
                <tr key={i}>
                  <td>{t.hour}</td>
                  <td>{t.subject}</td>
                  <td>{t.section}</td>
                  <td>
                    <select>
                      <option>Select Faculty</option>
                      <option>Dr. Anand</option>
                      <option>Ms. Priya</option>
                    </select>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>

          <button style={{ marginTop: "10px" }}>
            Submit Leave with Adjustment
          </button>
        </div>
      )}
    </div>
  );
}
